  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113755 includes biological,
  chemical, discrete sample, physical and profile data collected from HESPERIDES in
  the South Atlantic Ocean from 1996-01-17 to 1996-02-05 and retrieved during cruise
  CARINA/29HE19960117. These data include ALKALINITY, AMMONIUM, CHLOROPHYLL A, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PARTICULATE ORGANIC CARBON, PARTICULATE
  ORGANIC NITROGEN, PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE,
  WATER TEMPERATURE and pH. The instruments used to collect these data include CTD
  and bottle. These data were collected by Aida F. Rios of Instituto de Investigaciones
  Marinas de Vigo and R. Anadon and M. Estrada [affiliation unknown] as part of the
  CARINA/29HE19960117 data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean)
  data synthesis project is an international collaborative effort of the EU IP CARBOOCEAN,
  and U.S. partners. It has produced a merged internally consistent data set of open
  ocean subsurface measurements for biogeochemical investigations, in particular,
  studies involving the carbon system. The original focus area was the North Atlantic
  Ocean, but over time the geographic extent expanded and CARINA now includes data
  from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\":
